import React, {useState} from "react";

const UseState = () => {
    const [change, setChange] = useState(true);

    return(
        <>
            <button onClick={() => setChange(!change)}>
                Click Here !
            </button>

            { change ? <h1>Welcome to Dare Oyekunle</h1> : <h1>Welcome to coding</h1> }

        </>
    );
}

export default UseState;
